import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // Find and click the "Your Profile" link
    // There are multiple links with this text, so we'll click the first one.
    const profileLink = page.getByRole('link', { name: 'Your Profile' }).first();
    await profileLink.click();

    // Wait for the profile page content to be loaded and visible
    await page.waitForSelector('.profile-page', { state: 'visible' });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract data from the profile to verify the action
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('.profile-info .username').textContent();
    const bio = await page.locator('.profile-info .bio').textContent();

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim()
    };

    return {
      success: true,
      action: "Navigated to Jun's Profile page",
      extractedData: extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
